    false,nt"url": null,nt"notes": "During the summer, 1988, we conducted a
    duck nesting study to determine nest success for ducks at Stillwater Wildlife Management
    Area (WMA). We calculated nest success as the proportion of all nests that were
    successful, and 2) Bart Nest success for 31 dabbling duck nests was 39%. The most
    common nesting ducks were Cinnamon Teal, Mallard, and Gadwall. Most nests were located
    at Lead Lake. Comparisons to past studies of nesting success cannot be made without
    greater sample sizes, and the study should be continued over the nest 2-3 years.",nt"license_title":
